import React from 'react';
import './Styles/Heading.css';

function Heading() {
    return (
        <svg viewBox="0 0 1200 300">
  {/* Symbol */}
  <symbol id="s-text">
    <text textAnchor="middle" x="50%" y="50%" dy=".35em">
      Diego
    </text>
  </symbol>  
  <use xlinkHref="#s-text" className="text" />
  <use xlinkHref="#s-text" className="text" />
  <use xlinkHref="#s-text" className="text" />
  <use xlinkHref="#s-text" className="text" />
  <use xlinkHref="#s-text" className="text" />
</svg>

    );
}

export default Heading;
